9","sourceId":0,"videoAutoplayNet":"\"wifi,4g,5g\"","combinateContent":"在沙巴和我最爱的人一起看最美日落\n一直就环滩岛和美人鱼岛中纠结，整体条件好像都差不多！\n环滩岛人少但坐船的时间长——追求人少拍照\n我和男友最终选择了环滩岛，抵达岛上那一刻觉得这一路的奔波非常值得。\n一片一片的蓝绿蓝绿的海，雪白色的沙滩。岛上非常干净。人也真的很少，整个岛好像就我们这一船人。所以可以尽情地拗造型拍照了。\n沙巴看日落的最佳时间是下午的6点到6点20左右，是看日落的黄金时间，不过你要是时间充裕，你可以从下午五点多一直呆到七点这样，因为也会遇到很壮光的晚霞！沙巴的日出就相对没有那么美了，个人感觉，所以日出看不看没什么意思，但是日落是一定要看的。"}},{"type":1,"article":{"articleId":4300992,"productType":5,"sourceType":126,"articleTitle":"游普吉岛这样拍照 朋友圈至少10000赞","content":"【什么时间拍】普吉岛全年平均气温在30度左右，晴天阳光比较强，9:30以后就有热感了，16:30左右开始日落。因此可以选择在8：00-9：30和16:00-18：00这段时间进行拍摄，光线较为柔和，也能邂逅朝阳和晚霞。\n \n【去哪儿拍】根据当地的天气特点，建议先拍海边照再去街拍，之后可以在入住的酒店拍点小景。\n \n【穿什么颜色】在海边拍摄最好选择亮色系的衣物，这些颜色不仅能让你活力爆表，还能让你在海天背景下成为视觉焦点。当然，中性的白色也很搭。如果是街拍，黑、灰等深色衣服可别穿哦，因为会与街头建筑的颜色“撞衫”。\n \n【穿什么款式】海边：长裙会凸显你的摇曳多姿，泳装能让你显得性感而秀美；街拍：因为要移步换景，牛仔裤、T恤之类的休闲装想必是极好的。\n \n【天气怎么选】如果你对雨景情有独钟，可事先备一把透明雨伞，摄影师会帮你拍出清新、文艺风的照片。由于非晴天的光线不佳，而摄影又是光影艺术，所以最好选择阳光明媚的日子拍摄。\n \n【拍什么风格】提前告诉摄影师自己想要的拍摄风格，然后根据摄影师的建议做好相关准备。\n \n【Tips】普吉岛沙滩上没有更衣场所，可以带上浴巾等物品，在需要时当帘幕使用。","author":{"authorId":410588,"nickName":"一美一拍","clientAuth":"7680DA32E26E448FDE0AC740D45BD611","userUrl":"https://m.ctrip.com/webapp/you/tripshoot/user/home?seo=0&clientAuth=7680DA32E26E448FDE0AC740D45BD611&isHideHeader=true&isHideNavBar=YES","jumpUrl":"https://m.ctrip.com/webapp/you/user?clientAuth=7680DA32E26E448FDE0AC740D45BD611","coverImage":{"dynamicUrl":"https://dimg04.c-ctrip.com/images/Z80u15000000xfbnkB341_C_180_180.jpg","originalUrl":"https://dimg04.c-ctrip.com/images/Z80u15000000xfbnkB341_C_180_180.jpg"},"identityType":16,"identityTypeName":"玩乐商家","tag":"","followCount":117188,"vIcon":"https://dimg04.c-ctrip.com/images/0104h1200082xuj970D87.png","levelValue":6,"levelValueText":"","identityDesc":"","showTagList":[{"tagStyle":2,"tagType":1,"tagName":"玩乐商家","tagShortName":"玩乐商家"}]},"images":[{"imageId":303621229,"dynamicUrl":"https://youimg1.c-ctrip.com/target/100h10000000o5qan2ED2_R_640_10000_Q90.jpg?proc=source/tripshoot","originalUrl":"https://youimg1.c-ctrip.com/target/100h1000